import { DrinkWrapper, Price, Title } from './Drink.styled';

export default function Drink({ title, price }) {
  console.log(title, price);
  return (
    <DrinkWrapper>
      <Title>{title}</Title>
      <Price>{price}</Price>
    </DrinkWrapper>
  );
}
